import React, { Component } from "react";
import city from "../../common/csvjson.json";

class RideOffered extends Component {
  state = {};

  options = city;
  componentDidMount() {
    const options = city;
    console.log(options.map.filter(options.country == "Canada"));
  }

  render() {
    return <div>Ride Offered Info page</div>;
  }
}

export default RideOffered;
